styles:
.plonter-context-menu {
    background-color: rgba(250, 250, 250, 0.8);
    box-shadow: 1px 1px 5px 0px rgba(0, 0, 0, 0.15);
}

.plonter-item {
    cursor: pointer;
    padding: 2px 15px;
    text-align: start;
}

.plonter-item:hover {
    background-color: rgba(0, 0, 0, 0.15);
}

:host {
    position: absolute;
    top: 20px;
    left: 20px;
    width: 20px;
    height: 20px;
    z-index: 999;
    -webkit-user-drag: none;
}

.button-container {
    border-radius: 1px;
    background-color: rgba(255, 255, 255, 0.8);
    height: 30px;
    width: 30px;
    padding: 5px;
    transition: all 0.2s;
    cursor: pointer;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
}

.button-container:hover {
    background-color: rgba(255, 255, 255, 0.95);
}

.icon {
    height: 30px;
    width: 30px;
}
